import React from 'react';
import './Styles.css';

function Locations() {
    return(
        <div className='mainSpace'>
            <center>
                <h1>Locations</h1>
                Prefer the smell and environment of a real bookstore? We have several locations across the states!
            </center>
        </div>
    )
}

export default Locations;
